import React from 'react'
import students from '../../data/students'

const list = students.map(student => {
    let {id, name} = student
    return (
        <li key={student.id} style={{ listStyle: 'none' }}>
            {student.id + 1}) {student.name}: {student.grade}
        </li>
    )
})

export default () => {

    return (
        <ul>
            {list}
        </ul>
    )
}
